import admin from './img/admin.jpg'

const App = () => {

    const redirectToApi = () => {
        redirect.push('/api'); // Redirects to localhost:3000/api
    };
    
    return(
        <div className='main-frame'>
            <div className='picture'>
                <img src={admin} alt='Admin'></img>
            </div>
            <div className='info'>
                <p>Bondhon Shahriar Alam</p>
                <p>Bitr√§dande Rektor</p>
                <p>Mob: +46 76 108 78 89</p>
                <p>Mejl: bondhon.shahriaralam@ntig.se</p>
            </div>
            <button onClick={redirectToApi}>Go to Api Page</button>

            <Weather />
        </div>
    )
}

const container = document.getElementById('root');
const root = createRoot(container);
root.render(<App />);
